import { useState } from "react";
import '../ComponentStyles/login.css'
import { Button } from "react-bootstrap";

function Login() {

    const [loginUsername, setLoginUsername] = useState("");
    const [loginPassword, setLoginPassword] = useState("");

    return (
        <div className="login-container">
            <div className="login-card">
                <div className="login-title-container">
                    <h3>Log in to Your Account</h3>
                </div>
                <div className="login-inputs-container">
                <div class="input-group mb-3">
                    <span class="input-group-text" id="basic-addon1">
                        <i class="bi bi-envelope-at-fill"></i>
                    </span>
                    <input value={loginUsername} onChange={(e) => setLoginUsername(e.target.value)} 
                        className="form-control header-input login-input" />
                </div>
                <div class="input-group mb-3">
                    <span class="input-group-text" id="basic-addon1">
                        <i class="bi bi-shield-fill-check"></i>
                    </span>
                    <input value={loginPassword} type="password" onChange={(e) => setLoginPassword(e.target.value)} 
                    className="form-control header-input login-input" />  
                </div> 
                </div>
                <div className="login-btn-container">
                    <Button variant="btn btn-success" className="login-btn">Log In</Button>
                </div>
            </div>
        </div>
    )
}

export default Login;
